import itertools

def rotate(board):
    return ''.join(''.join(x[i] for x in board) for i in range(5)[::-1])

def flip(board):
    return ''.join(x[::-1] for x in board)

def count_configurations(boards):
    # Remove duplicates by converting to set
    boards = set(''.join(boards[i:i+5]) for i in range(0, 10, 5))

    # Count configurations
    count = 0
    for v in itertools.combinations(boards, 5):
        h = tuple(x for x in boards if x not in v)
        for _ in range(4):
            for _ in range(4):
                if len(v) == 5 and len(h) == 5:
                    count += 1
                v = rotate(v)
                h = rotate(h)
            v = flip(v)
            h = flip(h)
    return count

def main():
    while True:
        line = input()
        if line == "END":
            break
        boards = line.split()
        print(count_configurations(boards))

if __name__ == "__main__":
    main()
